export function add14(a: number, b: number): number {
  return a + b;
}

export function subtract14(a: number, b: number): number {
  return a - b;
}

export function multiply14(a: number, b: number): number {
  return a * b;
}

export function divide14(a: number, b: number): number {
  return a / b;
}
